import "./App.css";
import AOS from "aos";
import "aos/dist/aos.css";
import React, { Component } from "react";
import { useEffect } from "react";
import Announcement from "./components/Annoucement";
import Carousel from "./components/Carousel";
import Contact from "./components/Contact";
import Copyright from "./components/Copyright";
import Reception from "./components/Reception";
import Sangeet from "./components/Sangeet";
import Wedding from "./components/Wedding";
import "./assets/fonts/cavolini/CAVOLINI.TTF";
import NavBar from "./components/NavBar";
import Section from "./components/Section";
import dataJson from "./components/data.json";

class MyApp extends Component {
	componentDidMount() {
		AOS.init({ duration: 1200 });
	}

	render() {
		const data = dataJson.data;
		console.log(data[0].title);
		return (
			<div className="App font-face-gm">
				<NavBar />
				{/* <Navbar /> */}
				<Carousel />
				<br />
				<div data-aos="zoom-in">
					<Announcement />
				</div>
				<div data-aos="zoom-in">
					<Sangeet />
					<Section
						heading={data[0].title}
						tagLine={data[0].tagLine}
						description={data[0].description}
						day={data[0].when.day}
						date={data[0].when.date}
						month={data[0].when.month}
						year={data[0].when.year}
						startTime={data[0].when.startTime}
						endTime={data[0].when.endTime}
						addressLine1={"Mahajan Banquet, Opp Kanakia "}
						addressLine2={"Police Station, Baverly Park, "}
						addressLine3={"Mira Road(E), Thane (India)."}
						location={"https://goo.gl/maps/wjLcyUxfzTy4jry9A"}
					/>
				</div>
				<div data-aos="zoom-in">
					<Wedding />
				</div>
				<div data-aos="zoom-in">
					<Reception />
				</div>
				<div data-aos="zoom-in">
					<Contact />
				</div>
				<Copyright />
			</div>
		);
	}
}

export default MyApp;
